import BoggleLogo from './images/logo.png';

function App() {
  return (
    <Grid fluid id='app'>
      <Row>
        <img src={BoggleLogo} className='logo' />
      </Row>
      <Row>
      Current Word, Submit Word Button
      </Row>
      <div id='board'>
        <div class='row'>

          <div class='char'>
            asdfasdf
          </div>
        </div>
      </div>
      <div id='score-table'></div>


    </Grid>
  );
}

export default App;
